import React, { Component } from 'react';
import ReactBootstrap, {Container, Row, Col, FormGroup} from 'react-bootstrap'; 


class SuggestionBox extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			suggested_items: []
		}
	}
	render() {
	    return (
			<div className='suggest-box-wrapper'>
				<select className='ls-none'>
					{this.state.suggested_items}
				</select>
			</div>
	    )
	}

	componentWillReceiveProps() {		
		// this.setState({suggested_items: this.props.suggestions});
	}

	shouldComponentUpdate(nextProps) {
		const next_props = this.props.suggestions !== nextProps;		

		return next_props;
	}

	componentWillMount() {
		this.forceUpdate();
		this.state.suggested_items.push(<option tabindex=''>{this.props.suggestions}</option>);
	}
}

export default SuggestionBox;
